INSERT INTO `txzh_article` VALUES (19, '为何现在男人怕女人?', '为何现在男人怕女人?', '&lt;div class=&quot;header&quot; style=&quot;position: fixed; top: 0px; left: 0px; z-index: 9999; margin-bottom: 20px; width: 1000px; height: 60px; background-color: rgb(0, 0, 0); color: rgb(50, 50, 50); font-family: &amp;quot;Century Gothic&amp;quot;, &amp;quot;Microsoft yahei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;&lt;div class=&quot;hd-main cf&quot; style=&quot;zoom: 1; margin-right: auto; margin-left: auto; width: 1000px;&quot;&gt;&lt;ul class=&quot;main-nav&quot; style=&quot;list-style-position: initial; list-style-image: initial; float: left;&quot;&gt;&lt;li style=&quot;float: left;&quot;&gt;&lt;a href=&quot;http://undefined&quot; style=&quot;color: rgb(255, 255, 255); display: inline-block; padding: 0px 16px; height: 60px; line-height: 60px; font-size: 16px; font-weight: bold; vertical-align: middle;&quot;&gt;首页&lt;/a&gt;&lt;/li&gt;&lt;li style=&quot;float: left;&quot;&gt;&lt;a href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(255, 255, 255); display: inline-block; padding: 0px 16px; height: 60px; line-height: 60px; font-size: 16px; font-weight: bold; vertical-align: middle;&quot;&gt;扩展&lt;/a&gt;&lt;/li&gt;&lt;li style=&quot;float: left;&quot;&gt;&lt;a href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(255, 255, 255); display: inline-block; padding: 0px 16px; height: 60px; line-height: 60px; font-size: 16px; font-weight: bold; vertical-align: middle;&quot;&gt;教程&lt;/a&gt;&lt;/li&gt;&lt;li class=&quot;current&quot; style=&quot;float: left;&quot;&gt;&lt;a href=&quot;http://undefined&quot; style=&quot;color: rgb(255, 255, 255); display: inline-block; padding: 0px 16px; height: 60px; line-height: 60px; font-size: 16px; font-weight: bold; vertical-align: middle; background-color: rgb(101, 101, 101);&quot;&gt;讨论&lt;/a&gt;&lt;/li&gt;&lt;li style=&quot;float: left;&quot;&gt;&lt;a href=&quot;http://undefined&quot; targ