rgin: 0px; padding: 0px; max-width: 100%;&quot;/&gt;&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;box best-cmt&quot; id=&quot;hot_review_top&quot; style=&quot;margin-bottom: 10px; border: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;div class=&quot;index-hd&quot; style=&quot;margin-bottom: 5px; padding-right: 10px; padding-left: 50px; height: 40px; line-height: 40px; color: rgb(0, 0, 0); border-bottom: 1px solid rgb(212, 212, 212); background: url(&amp;quot;../img/best.png&amp;quot;) 12px 4px no-repeat rgb(251, 251, 251); font-weight: bold; font-size: 16px;&quot;&gt;最佳答案&lt;/div&gt;&lt;div class=&quot;cmt-box&quot; style=&quot;padding: 15px; font-size: 16px;&quot;&gt;&lt;div class=&quot;cmt-item&quot; style=&quot;position: relative; margin-bottom: 10px; padding-left: 53px; min-height: 53px; line-height: 1.6; border-bottom: 0px;&quot;&gt;&lt;div class=&quot;cmt-item-best&quot;&gt;&lt;/div&gt;&lt;span class=&quot;avatar&quot; style=&quot;display: block; position: absolute; top: 0px; left: 0px; padding: 1px; width: 44px; height: 44px; line-height: 44px; text-align: center; border: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;img src=&quot;http://passport.onethink.cn/Avatar/000/010/29/80/80_80.gif&quot; style=&quot;margin: 0px; padding: 0px; width: 44px;&quot;/&gt;&lt;/span&gt;&lt;div class=&quot;comment-hd&quot;&gt;&lt;span class=&quot;username&quot; style=&quot;margin-right: 10px;&quot;&gt;imdante&lt;/span&gt;&amp;nbsp;&lt;span class=&quot;commment-time&quot; style=&quot;color: rgb(153, 153, 153);&quot;&gt;2015年12月26日&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;comment-bd&quot; id=&quot;&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;div class=&quot;cmt-txt&quot; style=&quot;margin-bottom: 10px; min-height: 28px;&quot;&gt;模板读取的时候转义一下就行了 需要使用两个函数或是一个函数来转义&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;tabbar&quot; class=&quot;box tabbar&quot; style=&quot;margin-bottom: 10px; border: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;div class=&quot;tab-nav cf&quot; style=&quot;zoom: 1; height: 40px; line-height: 40px; font-size: 16px; color: rgb(114, 185, 57); border-bottom: 1px solid rgb(212, 212, 212); background-color: rgb(244, 244, 244);&quot;&gt;&lt;span class=&quot;item selected&quot; style=&quot;float: left; padding: 0px 20px; height: 39px; cursor: pointer; border-right: 1px solid rgb(212, 212, 212); margin-top: -1px; color: rgb(51, 51, 51); border-top: 3px solid rgb(114, 185, 57); border-bottom: 0px; border-radius: 5px 5px 0px 0px; background-color: rgb(255, 255, 255);&quot;&gt;评论（&lt;span class=&quot;review-count&quot;&gt;3&lt;/span&gt;）&lt;/span&gt;&lt;span class=&quot;item&quot; style=&quot;float: left; padding: 0px 20px; height: 40px; cursor: pointer; border-right: 1px solid rgb(212, 212, 212);&quot;&gt;相关&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;tab-wrap&quot; class=&quot;tab-wrap&quot; style=&quot;padding: 10px 20px;&quot;&gt;&lt;div class=&quot;tab-comment item-content&quot; id=&quot;comment&quot;&gt;&lt;div class=&quot;cmt-box&quot; style=&quot;padding-top: 10px; padding-bottom: 20px; font-size: 16px;&quot;&gt;&lt;div class=&quot;cmt-item review_item_list&quot; style=&quot;position: relative; margin-bottom: 10px; padding-left: 53px; min-height: 53px; line-height: 1.6; border-bottom: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;a class=&quot;avatar&quot; href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(114, 185, 57); display: block; position: absolute; top: 0px; left: 0px; padding: 1px; width: 44px; height: 44px; line-height: 44px; text-align: center; border: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;img src=&quot;http://passport.onethink.cn/Avatar/000/019/96/13/80_80.gif&quot; style=&quot;margin: 0px; padding: 0px; width: 44px;&quot;/&gt;&lt;/a&gt;&lt;div class=&quot;comment-hd cf&quot; style=&quot;zoom: 1;&quot;&gt;&lt;span class=&quot;username&quot; style=&quot;margin-right: 10px; color: rgb(4, 72, 157); font-size: 14px;&quot;&gt;李奕迅&lt;/span&gt;&lt;span class=&quot;commment-time&quot; style=&quot;color: rgb(136, 136, 136); font-size: 14px;&quot;&gt;2015年12月26日&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;comment-bd&quot; id=&quot;145832&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;div class=&quot;cmt-txt&quot; style=&quot;margin-bottom: 10px; min-height: 28px; line-height: 1.6;&quot;&gt;我们在利用ThinkPHP提交数据的时候，数据库里的数据是含各种html标签的，那么在输出时就可以直接输出嘛。但是，也许你的老师曾经告诉过你，在进行后台数据提交的时候，要过滤掉html标签，如I(&amp;#39;content&amp;#39;,&amp;#39;&amp;#39;,&amp;#39;htmlspecialchars &amp;#39;)这样来操作的。但是经过这样的过滤后，你要是还想直接输出来或是进行截取字符的时候就会遇到很多的麻烦。本人经过多次摸索的实验，得来以下经验，希望分享了可以帮助到大家。&lt;br/&gt;总结：&lt;br/&gt;在运用富文本提交数据时，为了在数据输出时能够正常显示，有以下几种方法：&lt;br/&gt;1、在接收数据时采用如I(&amp;#39;content&amp;#39;,&amp;#39;&amp;#39;,&amp;#39;htmlspecialchars&amp;#39;)则在首页显示并截取数据字符串时，采用&lt;br/&gt;{$m.content|htmlspecialchars_decode|strip_tags|cut_str=###,200,0}&lt;br/&gt;其中，先把以过html转义过的数据“&amp;lt;”恢复成如“&amp;lt;a&amp;gt;”这样的html标签，再用strip_tags函数把所有的html数据都去除后再截取。&lt;br/&gt;包括其中的javascript代码都不会显示，也不会运行。&lt;br/&gt;在详细页中使用{$news.content|htmlspecialchars_decode=###}&lt;br/&gt;则在首页截取后显示的是有alert()代码，但不会显示其前面的&amp;lt;script&amp;gt;&amp;lt;/script&amp;gt;样的字符，同时在详细页中不会显示&amp;lt;script&amp;gt;&amp;lt;/script&amp;gt;&lt;br/&gt;以及其中间的所有代码。其他html标签正常输出转换。&lt;br/&gt;2、在接收数据时采用I(&amp;#39;content&amp;#39;)的形式，则在首页显示并截取数据字符串时，采用&lt;br/&gt;{$m.content|strip_tags|cut_str=###,200,0}&lt;br/&gt;其中，先把直接含html标签的数据利用strip_tags函数进行去除后，再截取字符串输出就可以了。&lt;br/&gt;在详细页中使用{$news.content|htmlspecialchars_decode=###}，则在首页截取后显示的是有alert()代码，并且还会有其前面的&amp;lt;script&amp;gt;&amp;lt;/script&amp;gt;样的字符，&lt;br/&gt;在详细页中，这个会显示javascript所有完整代码，但不会执行。&lt;br/&gt;3、在接收数据时采用I(&amp;#39;content&amp;#39;,&amp;#39;&amp;#39;,&amp;#39;htmlspecialchars&amp;#39;)的形式，则在首页显示并截取数据字符串时采用&lt;br/&gt;{$m.content|htmlspecialchars_decode|strip_tags|cut_str=###,200,0}&lt;br/&gt;在详细显示页时使用{$news.content}显示&lt;br/&gt;则首页截取的字符串正常，详细页中的数据显示也是正常的，完整的javascript代码会显示，但不会执行。&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;cmt-item review_item_list&quot; style=&quot;position: relative; margin-bottom: 10px; padding-left: 53px; min-height: 53px; line-height: 1.6; border-bottom: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;a class=&quot;avatar&quot; href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(114, 185, 57); display: block; position: absolute; top: 0px; left: 0px; padding: 1px; width: 44px; height: 44px; line-height: 44px; text-align: center; border: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;img src=&quot;http://passport.onethink.cn/Avatar/000/019/96/13/80_80.gif&quot; style=&quot;margin: 0px; padding: 0px; width: 44px;&quot;/&gt;&lt;/a&gt;&lt;div class=&quot;comment-hd cf&quot; style=&quot;zoom: 1;&quot;&gt;&lt;span class=&quot;username&quot; style=&quot;margin-right: 10px; color: rgb(4, 72, 157); font-size: 14px;&quot;&gt;李奕迅&lt;/span&gt;&lt;span class=&quot;commment-time&quot; style=&quot;color: rgb(136, 136, 136); font-size: 14px;&quot;&gt;2015年12月26日&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;comment-bd&quot; id=&quot;145826&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;div class=&quot;cmt-txt&quot; style=&quot;margin-bottom: 10px; min-height: 28px; line-height: 1.6;&quot;&gt;应该是使用htmlspecialchars_decode()&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;cmt-item review_item_list&quot; style=&quot;position: relative; margin-bottom: 10px; padding-left: 53px; min-height: 53px; line-height: 1.6; border-bottom: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;a class=&quot;avatar&quot; href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(114, 185, 57); display: block; position: absolute; top: 0px; left: 0px; padding: 1px; width: 44px; height: 44px; line-height: 44px; text-align: center; border: 1px solid rgb(212, 212, 212);&quot;&gt;&lt;img src=&quot;http://passport.onethink.cn/Avatar/000/010/29/80/80_80.gif&quot; style=&quot;margin: 0px; padding: 0px; width: 44px;&quot;/&gt;&lt;/a&gt;&lt;div class=&quot;comment-hd cf&quot; sty