/h3&gt;&lt;ul style=&quot;list-style-position: initial; list-style-image: initial;&quot;&gt;&lt;li&gt;&lt;a href=&quot;http://undefined&quot; style=&quot;color: rgb(126, 130, 131);&quot;&gt;BUG反馈&lt;/a&gt;&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;http://undefined&quot; style=&quot;color: rgb(126, 130, 131);&quot;&gt;技术讨论&lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;div class=&quot;ft-intro&quot; style=&quot;float: left; padding-right: 20px; width: 574px; color: rgb(126, 130, 131); background: url(&amp;quot;../img/bottom_solid.png&amp;quot;) right center no-repeat;&quot;&gt;&lt;div class=&quot;btm-logo&quot; style=&quot;background: url(&amp;quot;../img/bottom_logo.png&amp;quot;) 480px 105px no-repeat;&quot;&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px;&quot;&gt;ThinkPHP 是一个免费开源的，快速、简单的面向对象的 轻量级PHP开发框架 ，创立于2006年初，遵循Apache2开源协议发布，是为了敏捷WEB应用开发和简化企业应用开发而诞生的。ThinkPHP从诞生以来一直秉承简洁实用的设计原则，在保持出色的性能和至简的代码的同时，也注重易用性。并且拥有众多的原创功能和特性，在社区团队的积极参与下，在易用性、扩展性和性能方面不断优化和改进，已经成长为国内最领先和最具影响力的WEB应用开发框架，众多的典型案例确保可以稳定用于商业以及门户级的开发。&lt;/p&gt;&lt;div class=&quot;copyright&quot; style=&quot;margin-top: 20px; font-weight: bold;&quot;&gt;沪ICP备12007941号-2&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 1, 0, 1601055213, 0, '/uploads/2020-09-26/20200926/16010552118031.png', 0);
